import React from 'react';
import Button from './Button';

const Quadrant = ({title, buttons}) => {
  return (
    <div className="quadrant">
      <h2>{title}</h2>
      {buttons.map((button, index) => <Button key={index} label={button} />)}
    </div>
  );
};

export default Quadrant;
